import './scssPages/formRegistr.scss'


const FormRegisr = () => {
      return (
            <div className='form_registr'>
                  <form action="">
                        <label htmlFor="">Логин
                              <input type="text" />
                        </label>
                        <label htmlFor=""> Пароль
                              <input type="password" />
                        </label>
                  </form>

            </div>
      );
}

export default FormRegisr;
